(23413, '4416E0A1-FF5C-4F7A-AD19-0C58433A0B10', 'Sorry if the conversation was more hostile this morning than it needed to be. I’m realizing that when you’re sharing feelings, I️ have feelings too. I️’m not always sure what to do when I’m feeling my own set of feelings as you are sharing yours. Would love to chat about it more', 'Nitzan', 'David', '2021-03-30T10:47:47.667405'),
(23414, '381998BA-88B6-4C88-A11C-002FD063C81D', 'But in the meanwhile what I️ can say is that things that are important to you, are also important to me. I didn’t mean to make it seem like I️ don’t care about your feelings about the table being set and what that conveys to kids.', 'Nitzan', 'David', '2021-03-30T10:49:04.732528'),
