(23417, '98086E13-DBC6-4D89-87A3-9479A288BF8B', 'I think we need to get better at recognizing more quickly when we are getting into debates and just pause and work through what we had discussed with Priscilla. As I reflect, it was the feeling that I wasn’t being listened to in the moment that was making me agitated...and we have tools for both of us to head this off.', 'David', 'Nitzan', '2021-03-30T10:55:17.394000'),
(23418, '7A85996B-E93B-41B5-9E79-D6F93A7BA29F', 'And I understand that you were having the same reaction to me...that I was not listening.', 'David', 'Nitzan', '2021-03-30T10:55:52.836000'),
(23420, '8F6EC1DF-E9CB-4AB2-81E2-844FC14F04DC', 'I️ think there’s something underneath the conversation that triggers me. Cutting it off because you say I’m not listening is really hard...because I’m also trying to help you understand something about what happened in that moment. Once it became clear that you weren’t saying that “we should set the table” was a command that I️ should set the table, it allowed me to be in a different frame of mind. So I️’d like to offer up something to explore with Pricialla around this.', 'Nitzan', 'David', '2021-03-30T10:57:58.888219'),
(23421, '5592D82D-BB3C-4904-82AA-6F6068F99B78', 'It just feels like we’re not having a full conversation and we miss things in the process.', 'Nitzan', 'David', '2021-03-30T10:58:16.535228'),
(23422, 'AF926C55-EF54-4186-9201-88C0926A0E72', 'And some of that is about head related things too, that help to clarify.', 'Nitzan', 'David', '2021-03-30T10:58:33.005260'),
(23423, '602ED311-E66E-4C65-BC90-FEBAEB2F08F3', 'One way to get there may have been you saying something like “I’m feeling defensive (or whatever the dominant feeling was) because  you were commanding me to do something when I told you I was unavailable”', 'David', 'Nitzan', '2021-03-30T11:01:07.278000'),
(23424, '497FC806-298D-4793-BA8C-DCEF94D6CF24', 'I️ understand the larger point you are making here and I️ will try that. It’s also important that you know, I️ didn’t command you to do anything. I️ didn’t say “don’t do music.” It’s true that I️ wish you hadn’t started it at that moment in time, but I️ didn’t say that. And I️ think you are mis-remembering. Maybe it doesn’t matter, but it’s hard for me to be told that I️ said something when I️ didn’t.', 'Nitzan', 'David', '2021-03-30T11:04:00.053714'),
(23425, '1D29FA8F-5007-4EC1-83D7-E298501742AC', 'I was talking about the table setting convo this morning?', 'David', 'Nitzan', '2021-03-30T11:06:00.323000'),
